@-moz-document domain("psychologytoday.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, #header, #header .tl, #header .tr, div#contentColumn, .article-abstract, span.submitted, div#rightColumn, .node-type-collection #main, .node-type-collection-item #main, #rightColumn .collections-block, .pt-box, .node-type-collection #wrapper_bottom, .node-type-collection-item #wrapper_bottom, div#connect, div#main, div#blog-subscribe-block, .block-blog_authors div.row-even, .directory-mini, div#wrapper_bottom, #block-webmd_widget_300 .webmd-widget-bottom-search, .node-article, div.comment-link

{
color: white !important;
background: black !important;
}

#www-front-new-blog-topics a, ul.nice-menu-down .menuparent li a, ul.nice-menu-down .menuparent.over li a, ul.nice-menu-down .menuparent:hover li a

{
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre, a.pt-collections-block-index-item:hover

{
